import Overlay from "./Overlay";

const ConfirmOverlay = ({text}) => {
    return (
        <Overlay>
            <div className="center">
                <h3>{text}</h3>
                <button>Ja</button>
                <button>Avbryt</button>
            </div>
        </Overlay>
    )
}

export default ConfirmOverlay;
